DROP TABLE IF EXISTS `tariff`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tariff` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(45) DEFAULT NULL,
  `calls_limit` int(11) NOT NULL COMMENT 'Maksimalni broj poziva koji kartica moze da napravi pre resetovanja counter-a (counter se resetuje 1-dnevno ali moze i na zadati interval ili datum)',
  `duration_limit` int(11) DEFAULT NULL COMMENT 'Maksimalno trajanje poziva koji kartica moze da napravi pre resetovanja counter-a (counter se resetuje 1-dnevno ali moze i na zadati interval ili datum)',
  `use_bonus_only` int(11) DEFAULT NULL COMMENT 'Kartica koristi samo bonus minute?',
  `pause_after_loading` int(11) DEFAULT NULL COMMENT 'Pauza koju kartica mora da napravi pre nego sto pocne da pravi bilo koju akciju nakon registrovanja na mrezu.\n',
  `generated_calls` int(11) DEFAULT NULL COMMENT 'Procenat generisanih poziva u odnosu na ukupan broj poziva.',
  `generated_calls_duration` int(11) DEFAULT NULL COMMENT 'Trajanje generisanih poziva',
  `no_load_block` int(11) DEFAULT NULL COMMENT 'maksimalni broj pokusaja da se kartica prijavi na mrezu pre nego sto se blokira',
  `loading_timeout` int(11) DEFAULT NULL COMMENT 'vreme koje kartica provede pokusavajuci da se registruje na mrezu. Nakon isteka vremena racuna se da je napravljen neuspesan pokusaj registracije.',
  `min_balance` float DEFAULT NULL COMMENT 'Minimalna kolicina novca posle koje sistem blokira karticu i vise je ne koristi',
  `pause` int(11) DEFAULT NULL COMMENT 'Minimalna pauza izmedju poziva',
