CREATE DEFINER=`root`@`localhost` PROCEDURE `getChannelSpool`(
IN pChannelAuth VARCHAR(10)
)
main_label:BEGIN
	DECLARE v_error CHAR(5);
	DECLARE v_error_text TEXT;
    DECLARE vgw_chan_id INT(10) DEFAULT 0;
	DECLARE v_simcard_id INT(10) DEFAULT 0;
    DECLARE v_spool_id INT(10) DEFAULT 0;
    
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1 v_error = RETURNED_SQLSTATE, v_error_text = MESSAGE_TEXT;
        SELECT CONCAT('Error:', v_error, '; ', v_error_text);
    END;

	-- Remember spool_id that is going to be returned
	SELECT
		`message_out`.id into v_spool_id
	FROM
		gateway_channel
			INNER JOIN
		card2gateway ON gateway_channel.id = card2gateway.gateway_channel_id
			INNER JOIN
		sim_card ON card2gateway.sim_card_id = sim_card.id
			INNER JOIN
		message_out ON message_out.sim_card_id = sim_card.id
			LEFT JOIN
		sim_card_spool `scs` ON message_out.id = `scs`.message_id
	WHERE
		gateway_channel.authentication = pChannelAuth AND 
        UPPER(card2gateway.last_gsm_status) = 'LOGIN' AND  
        (message_out.status = 'U' OR message_out.status = 'Q') AND
        (`scs`.retry IS NULL OR (`scs`.retry < 5 AND TIME_TO_SEC(TIMEDIFF(now(), `scs`.time)) > 20))
	ORDER BY TIME ASC LIMIT 1;

	IF v_spool_id = 0 THEN 
		SELECT 0;
		LEAVE main_label;
    END IF;
    
	-- Check if any messages in the spool for channel if gsm_state of channel is ok
	SELECT 
		message_out.*,
		gateway_channel.password,
		gateway_channel.local_port,
		gateway_channel.local_ip
	FROM
		gateway_channel
			INNER JOIN
		card2gateway ON gateway_channel.id = card2gateway.gateway_channel_id
			INNER JOIN
		sim_card ON card2gateway.sim_card_id = sim_card.id
			INNER JOIN
		message_out ON sim_card.id = message_out.sim_card_id
	WHERE
		message_out.id = v_spool_id
	;
    
    -- Set time and that spool is in progress
	INSERT INTO sim_card_spool(message_id, retry) VALUES (v_spool_id, 1)
    ON DUPLICATE KEY UPDATE retry = retry + 1, time = now();
    
    UPDATE message_out set status = 'Q' where message_out.id = v_spool_id;
    
    SELECT  sim_card_id into v_simcard_id from message_out where id = v_spool_id;
    select gateway_channel_id into vgw_chan_id from card2gateway  where sim_card_id = v_simcard_id;
    
	INSERT INTO 
		gateway_events(`card2gateway_sim_card_id`, `card2gateway_gateway_channel_id`, `description`) 
	VALUES 
		(v_simcard_id,
        vgw_chan_id,
		concat('Message ', v_spool_id, ' taken from spool'));
    
END ;;
DELIMITER ;
