CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertCellInfoEvent`(
IN pAuth VARCHAR(20), 
IN pCellInfo VARCHAR(30)
)
main_label:BEGIN
	DECLARE v_error CHAR(5);
	DECLARE v_error_text TEXT;
	DECLARE vgw_chan_id, vsim_card_id INT(10) DEFAULT 0;
    DECLARE v_indx INT DEFAULT 1;
    DECLARE v_slice varchar(20);
    DECLARE v_carrier_id INT;
    DECLARE v_gsmlac_id, v_gsmlac_compare_id INT DEFAULT 0;

	
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1 v_error = RETURNED_SQLSTATE, v_error_text = MESSAGE_TEXT;
        SELECT CONCAT('Error:', v_error, '; ', v_error_text);
    END;
    
    select id into vgw_chan_id from gateway_channel where authentication = pAuth;
    IF vgw_chan_id = 0 THEN
		SELECT 'Error: channel by authentication not found in table gateway channel';
        INSERT INTO log_error (`dt`, `description`) VALUES (now(), CONCAT('Error: channel by authentication ', pAuth, ' not found in table gateway channel'));
        LEAVE main_label;
    END IF;
    
    select card2gateway.sim_card_id into vsim_card_id from card2gateway WHERE gateway_channel_id = vgw_chan_id;
    IF vsim_card_id = 0 THEN
		SELECT 'Error: Sim card by gateway_id not found in table card2gateway';
        INSERT INTO log_error (`dt`, `description`) VALUES (now(), CONCAT('Error:Sim card by gateway_id:', vgw_chan_id, ' not found in table card2gateway'));
        LEAVE main_label;
	END IF;
    
    SELECT sim_card.carrier_id INTO v_carrier_id FROM sim_card WHERE sim_card.id = vsim_card_id;
    
    -- Parse lac info
    MyLoop: WHILE v_indx != 0 DO

		SET v_indx = LOCATE(',', pCellInfo);
        
        IF v_indx != 0 THEN
			SET v_slice = LEFT(pCellInfo, v_indx-1);
		ELSE
			SET v_slice = pCellInfo;
		END IF;
		
		SET pCellInfo = RIGHT(pCellInfo, LENGTH(pCellInfo) - v_indx);
        SET v_slice = REPLACE(v_slice, '"', '');
              
		INSERT IGNORE INTO gsmlac (lac, carrier_id) VALUES (v_slice, v_carrier_id);
        SELECT id INTO v_gsmlac_id FROM gsmlac WHERE carrier_id = v_carrier_id AND lac = v_slice;
        
        IF (v_gsmlac_id = 0) THEN
            SELECT LAST_INSERT_ID() INTO v_gsmlac_id;
        END IF;
        
		SELECT gsmlac_id into v_gsmlac_compare_id FROM simcard2lac WHERE sim_card_id = vsim_card_id ORDER by dt_change DESC LIMIT 1;
        IF (v_gsmlac_compare_id != v_gsmlac_id) THEN
			INSERT INTO simcard2lac(sim_card_id, gsmlac_id) VALUES (vsim_card_id, v_gsmlac_id);
		END IF;        
        
        IF LENGTH(pCellInfo) = 0 THEN
			LEAVE MyLoop;
		END IF;

	END WHILE;
            
    SELECT CONCAT("Success: ", vsim_card_id, " ", vgw_chan_id, " ", pCellInfo);
END ;;
DELIMITER ;
