CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertChannelEvent`(
IN pAuth VARCHAR(20), 
IN pImei VARCHAR(15), 
IN pLastGsmStatus VARCHAR(15), 
IN pLastVoipStatus VARCHAR(15), 
IN pLastVoipState VARCHAR(15),
IN pLastSignalStrength VARCHAR(15),
IN pRemoteAddress VARCHAR(15),
IN pRemotePort INT(15)
)
main_label:BEGIN
	DECLARE v_error CHAR(5);
	DECLARE v_error_text TEXT;
	DECLARE vgw_chan_id, vsim_card_id INT(10) DEFAULT 0;
    DECLARE count_relation INT(5);
	
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1 v_error = RETURNED_SQLSTATE, v_error_text = MESSAGE_TEXT;
        SELECT CONCAT('Error:', v_error, '; ', v_error_text);
    END;
    
    
    select id into vgw_chan_id from gateway_channel where authentication = pAuth;
    IF vgw_chan_id = 0 THEN
		SELECT 'Error: channel by authentication not found in table gateway channel';
        INSERT INTO log_error (`dt`, `description`) VALUES (now(), CONCAT('Error: channel by authentication ', pAuth, ' not found in table gateway channel'));
        LEAVE main_label;
    END IF;
    
    select sim_card.id into vsim_card_id from sim_card INNER JOIN imei ON sim_card.imei_id = imei.id WHERE imei = pImei;
    IF vsim_card_id = 0 THEN
		SELECT 'Error: Sim card by IMEI not found in table gateway channel';
        INSERT INTO log_error (`dt`, `description`) VALUES (now(), CONCAT('Error: Sim card by IMEI:', pImei, ' not found in table sim_card'));
        LEAVE main_label;
	END IF;
    
    -- Setovanje adrese i porta kojim se kanal kaci na smsserver. Potrebno zbog slanja komandi na taj kanal
    UPDATE gateway_channel SET local_ip = pRemoteAddress, local_port = pRemotePort WHERE gateway_channel.id = vgw_chan_id;
    
    -- Provera da li vec imamo ubacenu kombinaciju kartica - gateway_channel
    select count(*) INTO count_relation FROM card2gateway where sim_card_id = vsim_card_id AND gateway_channel_id = vgw_chan_id;
    
    IF count_relation = 0 THEN
		INSERT INTO card2gateway(`sim_card_id`, `gateway_channel_id`, `insert_time`) VALUES (vsim_card_id, vgw_chan_id, now());
	ELSE
		UPDATE 
			card2gateway 
		SET
            `last_gsm_status` = pLastGsmStatus, 
            `last_voip_status` = pLastVoipStatus, 
            `last_voip_state` = pLastVoipState, 
            `last_signal_strength` = pLastSignalStrength
		WHERE
			`sim_card_id` = vsim_card_id AND
            `gateway_channel_id` = vgw_chan_id;
    END IF;
    
    
    INSERT INTO 
		gateway_events(`card2gateway_sim_card_id`, `card2gateway_gateway_channel_id`, `description`) 
	VALUES 
		(vsim_card_id, vgw_chan_id, concat('Gsmstatus; ', pLastGsmStatus, 
												', Voip status: ', pLastVoipStatus, 
												', Voip state:', pLastVoipState, 
												', Signal:', pLastSignalStrength));
    
    SELECT "Success:0";
END ;;
