CREATE DEFINER=`root`@`localhost` PROCEDURE `setUssdResponse`(
IN pMessageId INT(10),
IN pMessage	VARCHAR(255)
)
main_label:BEGIN
	DECLARE v_error CHAR(5);
	DECLARE v_error_text TEXT;
    DECLARE v_message_out_id INT(10) DEFAULT 0;
    DECLARE v_simcard_id INT(10) DEFAULT 0;
    
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1 v_error = RETURNED_SQLSTATE, v_error_text = MESSAGE_TEXT;
        SELECT CONCAT('Error:', v_error, '; ', v_error_text);
    END;

	-- Find which sim card has returned USSD message
    SELECT 
		message_out.id,
        message_out.sim_card_id
        into 
        v_message_out_id, 
        v_simcard_id
	FROM
		message_out
			INNER JOIN
		sim_card_spool ON sim_card_spool.message_id = message_out.id
	WHERE
		message_out.id = pMessageId;
	
    IF v_simcard_id = 0 THEN
		LEAVE main_label;
	END IF;
        
	-- If everything ok insert into message_in
    INSERT INTO message_in (`type`, `text`, `sim_card_id`) VALUES ('U', pMessage, v_simcard_id);
    
    -- Delete from spool, and set status of USSD message_out to SENT
    DELETE FROM sim_card_spool where message_id = pMessageId;
    UPDATE message_out SET `sent` = now(), `status` = 'S';
    
    SELECT 1;
END ;;
DELIMITER ;
